&lt;P class=MsoNormal style=&quot;MARGIN-BOTTOM: 12pt&quot;&gt;&lt;FONT face=&quot;Times New Roman&quot; size=3&gt;&lt;SPAN style=&quot;FONT-SIZE: 12pt&quot;&gt;From: rosemary_guiley &lt;reguiley@aol. com&gt;&lt;BR&gt;Subject: [EVP-ITC] You Tube Video and Audio&lt;BR&gt;To: EVP-ITC@yahoogroups .com&lt;BR&gt;Date: Monday, June 30, 2008, 11:03 PM&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/P&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt;Hi Folks,&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/PRE&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt; &nbsp;&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/PRE&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt;Recently I did an investigation at the Lincoln Theater in
 Decatur , IL&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/PRE&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt;with my Mini-Box, and got some interesting clips from the basement&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/PRE&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt;area.&nbsp; The files are too large to be uploaded to the forum here, but a&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/PRE&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt;short video with the audio clips has been posted on You Tube by Joey&lt;/SPAN&gt;&lt;/FONT&gt;&lt;/PRE&gt;&lt;PRE&gt;&lt;FONT face=&quot;Courier New&quot; size=2&gt;&lt;SPAN style=&quot;FONT-SIZE: 10pt&quot;&gt;Tito, a
